import { ApolloClient } from "apollo-client";
import { InMemoryCache } from "apollo-cache-inmemory";
import { createHttpLink } from "apollo-link-http";
import fetch from "node-fetch";

import Layout from '../components/Layout';

const cache = new InMemoryCache();
const link = createHttpLink({ uri: "https://api.spacex.land/graphql/", fetch: fetch });

export const client = new ApolloClient({
    cache,
    link
});

const index = () => (
    <div>
        <Layout>
            <h1>Hello world</h1>
            <img src="/home_bkgi.jpg" alt="my image" />
        </Layout>

        <style jsx>{`
            Layout{
                background-image: url("https://spacenews.com/wp-content/uploads/2020/01/32040174268_089e044b62_k-879x485.jpg");
                background-attachment: fixed;
                background-position: center;
                background-repeat: no-repeat;
                background-size: cover;
                height: 100vh;
            }
      `}</style>
    </div>
);

export default index;
